import React, { useEffect, useState } from "react";

import Homepage_Btn from './Homepage_Btn.js'

import axios from 'axios';

export const My_Reviews = (props) => {

    const [REVIEWS ,updateREVIEWS] = useState([])

    useEffect(()=>{

        let USER;
        let STATUS;
        let REVIEWS;

        if(props.id){
            USER = props.id.userinfo
            STATUS = props.id.status
        }

        switch(STATUS){
            case('unverified'):
            return;

            case('verified'):        
            Load_Review(USER.id)
            return;

            default:
            return;
        }

    },[])

    const Review_Container = (props) => {

        console.log(props)

        switch(props.status){
            case('unverified'):
            return;

            case('verified'):
            const result = props.action(props.user_id)
            console.log(result)
            return <React.Fragment>

            <div></div>

            </React.Fragment>

        }

    }

    const Load_Review = async (user_id) => {
        await fetch(`/usercreation/read_reviews/${user_id}`).then( async (result)=>{
            const data = await result.json()
            console.log(data)
        })
    }


    const Dispense_Review_Data = (input)=>{

        let USER;

        if(input.id){ USER = input.id}

        switch(USER.status){
        case('unverified'):
            return;
        
        case('verified'):
            USER = USER.userinfo
            return <Review_Container
                status='verified'
                user_id={USER.id}
                
            />;

        case('undefined'):
            return;

        default:
            return;
    }
}

    return <React.Fragment>

        <div
        className="Personalize_Data_Page_Container"
        >

            <Homepage_Btn/>

            <div
            className="Personalized_Data_Container_Aligner"
            >
                <span
                className="Personalized_Data_Page_TextTitle"
                >
                My Reviews
                </span>
                <br></br>

                <span
                className="Personalized_Data_Page_TextTitle"
                >
                This Page
                <br></br>
                is Preparing
                </span>
            
                {/* {Dispense_Review_Data(props)} */}
                

            </div>

        </div>

    </React.Fragment>

}

export default My_Reviews
